INSERT INTO `article` VALUES ('1a93f6de5903fdd62d0c0af16993169d', '598108905656729600', 'springboot之集成Security（入门）', 'springboot之集成Security', '## springboot之集成Security，实现认证授权，权限控制\n -  #### 搭建框架\n 	使用security之前，需要先搭建一个web框架。\n 	比如我的是这样的\n![](https://img-blog.csdnimg.cn/20200724165053378.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L0Jlcm5pZV83,size_16,color_FFFFFF,t_70)\n然后写一个路由转接器。\n\n```java\n@Controller\npublic class RouterController {\n\n    @RequestMapping({\"/\",\"/index\"})\n    public String index() {\n        return \"index\";\n    }\n\n    @RequestMapping(\"/toLogin\")\n    public String toLogin() {\n        return \"views/login\";\n    }\n\n    @RequestMapping(\"/level1/{id}\")\n    public String level1(@PathVariable(\"id\") int id) {\n        return \"views/level1/\" + id;\n    }\n\n    @RequestMapping(\"/level2/{id}\")\n    public String level2(@PathVariable(\"id\") int id) {\n        return \"views/level2/\" + id;\n    }\n\n    @RequestMapping(\"/level3/{id}\")\n    public String level3(@PathVariable(\"id\") int id) {\n        return \"views/level3/\" + id;\n    }\n\n}\n```\n 然后就可以开始重点的部分了。\n \n -  #### 导包，需要一个security的包,和一个thymeleaf整合包，后面权限控制用\n  \n\n```java\n<!--thymeleaf整合包-->\n<dependency>\n	<groupId>org.thymeleaf.extras</groupId>\n	<artifactId>thymeleaf-extras-springsecurity5</artifactId>\n</dependency>\n<!--boot-starter-security-->\n     <dependency>\n	<groupId>org.springframework.boot</groupId>\n	<artifactId>spring-boot-starter-security</artifactId>\n</dependency>\n```\n\n -  #### 用户认证和授权\n  	我们需要有有一个配置类，继承WebSecurityConfigurerAdapter，然后重写里面的方法。我的习惯，**Talking is cheap~~**  还是先上代码吧\n```java\n//认证\n@EnableWebSecurity\npublic class SecurityConfig extends WebSecurityConfigurerAdapter {\n\n    @Override\n    protected void configure(HttpSecurity http) throws Exception {\n        http.authorizeRequests()\n                .antMatchers(\"/\").permitAll()//任何人都可以访问\n                .antMatchers(\"/index\").permitAll()\n                .antMatchers(\"/level1/**\").hasRole(\"vip1\")//需要vip？权限，下同\n                .antMatchers(\"/level2/**\").hasRole(\"vip2\")\n                .antMatchers(\"/level3/**\").hasRole(\"vip3\");\n\n          http.formLogin();//开启登录页面\n    }\n    \n}\n```\n\n\n	 认证步骤：\n	1. 继承 WebSecurityConfigurerAdapter 类\n	2. 重写 configure(HttpSecurity http) 方法，\n	3. 方法里面写你需要的配置\n	4. 开启注释 @EnableWebSecurity，托管给springboot。\n\n  一旦给页面写了权限认证，在新版的security框架中，进入需要权限的页面，会自动判断跳转一个登录页面，自带的。然后要求你登录。\n\n```java\n //授权\n @Override\n    protected void configure(AuthenticationManagerBuilder auth) throws Exception {\n\n        auth.inMemoryAuthentication().passwordEncoder(new BCryptPasswordEncoder())\n                .withUser(\"fang\").password(new BCryptPasswordEncoder().encode(\"123123\")).roles(\"vip1\", \"vip2\", \"vip3\")\n                .and()\n                .withUser(\"root\").password(new BCryptPasswordEncoder().encode(\"123123\")).roles(\"vip1\", \"vip2\")\n                .and()\n                .withUser(\"guest\").password(new BCryptPasswordEncoder().encode(\"123123\")).roles(\"vip1\");\n\n    }\n```\n    授权步骤:\n    1. 重写 configure(AuthenticationManagerBuilder auth) 方法\n	2. 方法里面写你需要的配置\n\n   说明一下\n   方法中的`auth.inMemoryAuthentication()`表示在内存中认证，`.passwordEncoder(new BCryptPasswordEncoder())`是密码加密。`roles()`授权\n\n如果需要用数据库认证，看下面官网的例子\n\n```java\n@Autowired\nprivate DataSource dataSource;\n\n@Autowired\npublic void configureGlobal(AuthenticationManagerBuilder auth) throws Exception {\n	auth\n		.jdbcAuthentication()\n			.dataSource(dataSource)\n			.withDefaultSchema()\n			.withUser(\"user\").password(\"password\").roles(\"USER\")\n			.and()\n			.withUser(\"admin\").password(\"password\").roles(\"USER\", \"ADMIN\");\n}\n```\n这样一来，用户的授权和认证都可以啦。运行测试一下。\n\n## 或者用我们自己写的方法\n\n```java\n    @Autowired\n    private UserDetailsService userDetailsService;//自己写的\n\n    // 授权\n    @Override\n    protected void configure(AuthenticationManagerBuilder auth) throws Exception {\n        auth.userDetailsService(userDetailsService).passwordEncoder(passwordEncoder());\n    }\n    \n    @Bean\n    PasswordEncoder passwordEncoder() {\n        return new BCryptPasswordEncoder();\n    }\n```\n\n```java\nimport com.fang.blogsystem.mapper.UserMapper;\nimport com.fang.blogsystem.pojo.DO.User;\nimport org.springframework.beans.factory.annotation.Autowired;\nimport org.springframework.security.core.GrantedAuthority;\nimport org.springframework.security.core.authority.AuthorityUtils;\nimport org.springframework.security.core.userdetails.UserDetails;\nimport org.springframework.security.core.userdetails.UserDetailsService;\nimport org.springframework.security.core.userdetails.UsernameNotFoundException;\nimport org.springframework.security.crypto.bcrypt.BCryptPasswordEncoder;\nimport org.springframework.stereotype.Service;\n\nimport java.util.List;\n\n/**\n * @author Bernie_xin\n * @create 2020/12/4 16:16\n **/\n@Service(\"userDetailsService\")//注意一定要加\npublic class MyUserDetailsService implements UserDetailsService {\n\n    @Autowired\n    private UserMapper loginUserMapper;\n\n    //在这里返回用户名和密码以及权限\n    @Override\n    public UserDetails loadUserByUsername(String s) throws UsernameNotFoundException {\n        //根据用户名做查询\n        User user = loginUserMapper.findUser(s);\n        if (user == null){\n            throw new UsernameNotFoundException(\"用户名不存在\");\n        }\n\n        List<GrantedAuthority> auth = AuthorityUtils.commaSeparatedStringToAuthorityList(\"ROLE_admin\");//这里本来也应该是数据库连表查询的\n        return new org.springframework.security.core.userdetails.User(user.getUsername(),//这里返回的user一定要是springframework.security的，由于我上面自己的user重名了，只能这么写。建议自己的用户类不需要写user，用sys_user之类的\n                new BCryptPasswordEncoder().encode(user.getPassword()),\n                auth);\n    }\n\n}\n\n```\n\n没问题则继续\n - #### 登录页面，退出登录以及首页配置\n我们上面用的是security自带的首页页面，但是我想用我自己的页面。怎么设置呢？\n很简单，在 `http.formLogin()` 后面继续 `.loginPage(\"/toLogin\")`。toLogin是我们前面写的去登录页面的请求。\n\n 我们在登录之后，首页就不应该再有什么登录的按钮啦，应该是注销按钮。\n \n\n```java\n			<!--登录注销-->\n            <div class=\"right menu\">\n                <!--未登录-->\n                <div sec:authorize=\"!isAuthenticated()\">\n                    <a  th:href=\"@{/toLogin}\">\n                        登录\n                    </a>\n                </div>\n                <!--注销-->\n                <div sec:authorize=\"isAuthenticated()\">\n                    <a th:href=\"@{/toLogin}\">\n                         注销\n                    </a>\n                </div>\n```\n\n通过`sec:authorize=\"!isAuthenticated()`判断是否登录。使用这个之前，需要导入命名空间。不导入也可以使用，但是会飘红报错。\n导入方法：\n页面顶部的html标签里面加上\n```java\n<html lang=\"en\" xmlns:th=\"http://www.thymeleaf.org\"\n      xmlns:sec=\"http://www.thymeleaf.org/thymeleaf-extras-springsecurity5\">\n```\n\n然后要开启注销。一行代码搞定\n\n```java\nhttp.logout().logoutSuccessUrl(\"/\");//logoutSuccessUrl(\"退出成功后跳转的页面\")\n```\n\n最后就是把那些没有访问权限的页面隐藏。\n也不难。就是在链接外面写一个div，里面`sec:authorize=\"hasRole(\'权限\')\"`，看下面的例子\n\n```java\n<div sec:authorize=\"hasRole(\'vip1\')\">\n	<a th:href=\"@{/level1/1}\">Level-1-1</a>\n</div>\n```\n然后测试，发现没有`vip1`，我都看不到`Level-1-1`。完成！\n\nsecurity学习的简单记录。如果这个篇博客对你有帮助。麻烦点个赞！', '<h2><a id=\"springbootSecurity_0\"></a>springboot之集成Security，实现认证授权，权限控制</h2>\n<ul>\n<li>\n<h4><a id=\"_1\"></a>搭建框架</h4>\n使用security之前，需要先搭建一个web框架。<br />\n比如我的是这样的<br />\n<img src=\"https://img-blog.csdnimg.cn/20200724165053378.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L0Jlcm5pZV83,size_16,color_FFFFFF,t_70\" alt=\"\" /><br />\n然后写一个路由转接器。</li>\n</ul>\n<pre><code class=\"lang-java\">@Controller\npublic class RouterController {\n\n    @RequestMapping({&quot;/&quot;,&quot;/index&quot;})\n    public String index() {\n        return &quot;index&quot;;\n    }\n\n    @RequestMapping(&quot;/toLogin&quot;)\n    public String toLogin() {\n        return &quot;views/login&quot;;\n    }\n\n    @RequestMapping(&quot;/level1/{id}&quot;)\n    public String level1(@PathVariable(&quot;id&quot;) int id) {\n        return &quot;views/level1/&quot; + id;\n    }\n\n    @RequestMapping(&quot;/level2/{id}&quot;)\n    public String level2(@PathVariable(&quot;id&quot;) int id) {\n        return &quot;views/level2/&quot; + id;\n    }\n\n    @RequestMapping(&quot;/level3/{id}&quot;)\n    public String level3(@PathVariable(&quot;id&quot;) int id) {\n        return &quot;views/level3/&quot; + id;\n    }\n\n}\n</code></pre>\n<p>然后就可以开始重点的部分了。</p>\n<ul>\n<li>\n<h4><a id=\"securitythymeleaf_40\"></a>导包，需要一个security的包,和一个thymeleaf整合包，后面权限控制用</h4>\n</li>\n</ul>\n<pre><code class=\"lang-java\">&lt;!--thymeleaf整合包--&gt;\n&lt;dependency&gt;\n	&lt;groupId&gt;org.thymeleaf.extras&lt;/groupId&gt;\n	&lt;artifactId&gt;thymeleaf-extras-springsecurity5&lt;/artifactId&gt;\n&lt;/dependency&gt;\n&lt;!--boot-starter-security--&gt;\n     &lt;dependency&gt;\n	&lt;groupId&gt;org.springframework.boot&lt;/groupId&gt;\n	&lt;artifactId&gt;spring-boot-starter-security&lt;/artifactId&gt;\n&lt;/dependency&gt;\n</code></pre>\n<ul>\n<li>\n<h4><a id=\"_56\"></a>用户认证和授权</h4>\n我们需要有有一个配置类，继承WebSecurityConfigurerAdapter，然后重写里面的方法。我的习惯，<strong>Talking is cheap~~</strong>  还是先上代码吧</li>\n</ul>\n<pre><code class=\"lang-java\">//认证\n@EnableWebSecurity\npublic class SecurityConfig extends WebSecurityConfigurerAdapter {\n\n    @Override\n    protected void configure(HttpSecurity http) throws Exception {\n        http.authorizeRequests()\n                .antMatchers(&quot;/&quot;).permitAll()//任何人都可以访问\n                .antMatchers(&quot;/index&quot;).permitAll()\n                .antMatchers(&quot;/level1/**&quot;).hasRole(&quot;vip1&quot;)//需要vip？权限，下同\n                .antMatchers(&quot;/level2/**&quot;).hasRole(&quot;vip2&quot;)\n                .antMatchers(&quot;/level3/**&quot;).hasRole(&quot;vip3&quot;);\n\n          http.formLogin();//开启登录页面\n    }\n    \n}\n</code></pre>\n<pre><code> 认证步骤：\n1. 继承 WebSecurityConfigurerAdapter 类\n2. 重写 configure(HttpSecurity http) 方法，\n3. 方法里面写你需要的配置\n4. 开启注释 @EnableWebSecurity，托管给springboot。\n</code></pre>\n<p>一旦给页面写了权限认证，在新版的security框架中，进入需要权限的页面，会自动判断跳转一个登录页面，自带的。然后要求你登录。</p>\n<pre><code class=\"lang-java\"> //授权\n @Override\n    protected void configure(AuthenticationManagerBuilder auth) throws Exception {\n\n        auth.inMemoryAuthentication().passwordEncoder(new BCryptPasswordEncoder())\n                .withUser(&quot;fang&quot;).password(new BCryptPasswordEncoder().encode(&quot;123123&quot;)).roles(&quot;vip1&quot;, &quot;vip2&quot;, &quot;vip3&quot;)\n                .and()\n                .withUser(&quot;root&quot;).password(new BCryptPasswordEncoder().encode(&quot;123123&quot;)).roles(&quot;vip1&quot;, &quot;vip2&quot;)\n                .and()\n                .withUser(&quot;guest&quot;).password(new BCryptPasswordEncoder().encode(&quot;123123&quot;)).roles(&quot;vip1&quot;);\n\n    }\n</code></pre>\n<pre><code>授权步骤:\n1. 重写 configure(AuthenticationManagerBuilder auth) 方法\n2. 方法里面写你需要的配置\n</code></pre>\n<p>说明一下<br />\n方法中的<code>auth.inMemoryAuthentication()</code>表示在内存中认证，<code>.passwordEncoder(new BCryptPasswordEncoder())</code>是密码加密。<code>roles()</code>授权</p>\n<p>如果需要用数据库认证，看下面官网的例子</p>\n<pre><code class=\"lang-java\">@Autowired\nprivate DataSource dataSource;\n\n@Autowired\npublic void configureGlobal(AuthenticationManagerBuilder auth) throws Exception {\n	auth\n		.jdbcAuthentication()\n			.dataSource(dataSource)\n			.withDefaultSchema()\n			.withUser(&quot;user&quot;).password(&quot;password&quot;).roles(&quot;USER&quot;)\n			.and()\n			.withUser(&quot;admin&quot;).password(&quot;password&quot;).roles(&quot;USER&quot;, &quot;ADMIN&quot;);\n}\n</code></pre>\n<p>这样一来，用户的授权和认证都可以啦。运行测试一下。</p>\n<h2><a id=\"_127\"></a>或者用我们自己写的方法</h2>\n<pre><code class=\"lang-java\">    @Autowired\n    private UserDetailsService userDetailsService;//自己写的\n\n    // 授权\n    @Override\n    protected void configure(AuthenticationManagerBuilder auth) throws Exception {\n        auth.userDetailsService(userDetailsService).passwordEncoder(passwordEncoder());\n    }\n    \n    @Bean\n    PasswordEncoder passwordEncoder() {\n        return new BCryptPasswordEncoder();\n    }\n</code></pre>\n<pre><code class=\"lang-java\">import com.fang.blogsystem.mapper.UserMapper;\nimport com.fang.blogsystem.pojo.DO.User;\nimport org.springframework.beans.factory.annotation.Autowired;\nimport org.springframework.security.core.GrantedAuthority;\nimport org.springframework.security.core.authority.AuthorityUtils;\nimport org.springframework.security.core.userdetails.UserDetails;\nimport org.springframework.security.core.userdetails.UserDetailsService;\nimport org.springframework.security.core.userdetails.UsernameNotFoundException;\nimport org.springframework.security.crypto.bcrypt.BCryptPasswordEncoder;\nimport org.springframework.stereotype.Service;\n\nimport java.util.List;\n\n/**\n * @author Bernie_xin\n * @create 2020/12/4 16:16\n **/\n@Service(&quot;userDetailsService&quot;)//注意一定要加\npublic class MyUserDetailsService implements UserDetailsService {\n\n    @Autowired\n    private UserMapper loginUserMapper;\n\n    //在这里返回用户名和密码以及权限\n    @Override\n    public UserDetails loadUserByUsername(String s) throws UsernameNotFoundException {\n        //根据用户名做查询\n        User user = loginUserMapper.findUser(s);\n        if (user == null){\n            throw new UsernameNotFoundException(&quot;用户名不存在&quot;);\n        }\n\n        List&lt;GrantedAuthority&gt; auth = AuthorityUtils.commaSeparatedStringToAuthorityList(&quot;ROLE_admin&quot;);//这里本来也应该是数据库连表查询的\n        return new org.springframework.security.core.userdetails.User(user.getUsername(),//这里返回的user一定要是springframework.security的，由于我上面自己的user重名了，只能这么写。建议自己的用户类不需要写user，用sys_user之类的\n                new BCryptPasswordEncoder().encode(user.getPassword()),\n                auth);\n    }\n\n}\n\n</code></pre>\n<p>没问题则继续</p>\n<ul>\n<li>\n<h4><a id=\"_189\"></a>登录页面，退出登录以及首页配置</h4>\n</li>\n</ul>\n<p>我们上面用的是security自带的首页页面，但是我想用我自己的页面。怎么设置呢？<br />\n很简单，在 <code>http.formLogin()</code> 后面继续 <code>.loginPage(&quot;/toLogin&quot;)</code>。toLogin是我们前面写的去登录页面的请求。</p>\n<p>我们在登录之后，首页就不应该再有什么登录的按钮啦，应该是注销按钮。</p>\n<pre><code class=\"lang-java\">			&lt;!--登录注销--&gt;\n            &lt;div class=&quot;right menu&quot;&gt;\n                &lt;!--未登录--&gt;\n                &lt;div sec:authorize=&quot;!isAuthenticated()&quot;&gt;\n                    &lt;a  th:href=&quot;@{/toLogin}&quot;&gt;\n                        登录\n                    &lt;/a&gt;\n                &lt;/div&gt;\n                &lt;!--注销--&gt;\n                &lt;div sec:authorize=&quot;isAuthenticated()&quot;&gt;\n                    &lt;a th:href=&quot;@{/toLogin}&quot;&gt;\n                         注销\n                    &lt;/a&gt;\n                &lt;/div&gt;\n</code></pre>\n<p>通过<code>sec:authorize=&quot;!isAuthenticated()</code>判断是否登录。使用这个之前，需要导入命名空间。不导入也可以使用，但是会飘红报错。<br />\n导入方法：<br />\n页面顶部的html标签里面加上</p>\n<pre><code class=\"lang-java\">&lt;html lang=&quot;en&quot; xmlns:th=&quot;http://www.thymeleaf.org&quot;\n      xmlns:sec=&quot;http://www.thymeleaf.org/thymeleaf-extras-springsecurity5&quot;&gt;\n</code></pre>\n<p>然后要开启注销。一行代码搞定</p>\n<pre><code class=\"lang-java\">http.logout().logoutSuccessUrl(&quot;/&quot;);//logoutSuccessUrl(&quot;退出成功后跳转的页面&quot;)\n</code></pre>\n<p>最后就是把那些没有访问权限的页面隐藏。<br />\n也不难。就是在链接外面写一个div，里面<code>sec:authorize=&quot;hasRole(\'权限\')&quot;</code>，看下面的例子</p>\n<pre><code class=\"lang-java\">&lt;div sec:authorize=&quot;hasRole(\'vip1\')&quot;&gt;\n	&lt;a th:href=&quot;@{/level1/1}&quot;&gt;Level-1-1&lt;/a&gt;\n&lt;/div&gt;\n</code></pre>\n<p>然后测试，发现没有<code>vip1</code>，我都看不到<code>Level-1-1</code>。完成！</p>\n<p>security学习的简单记录。如果这个篇博客对你有帮助。麻烦点个赞！</p>\n', '安全,java,Spring Boot,Security', 0, 'http://image.fangweb.top/Flj1gUXypIPefUqp7kcUfmLd-4Mt', 1, '2021-09-13 11:34:23', '2022-03-13 00:46:41', 0);
INSERT INTO `article` VALUES ('413541e9f0cf75517d75fe66cb4aeb9d', '598108905656729600', '基于springboot的logback日志管理', '基于springboot的logback日志管理', '\n学习日志管理的时候，网上查找了很多的博客，但是大多数说的都不是我想搞懂的东西，最后我找了B站尚硅谷雷神的视频看的。就比较完整且系统的了解了一下。如果需要可以自行去B站搜索springboot教程1的。\n\n看完之后，我还是去找了别的博客看了，才终于搞懂搞明白了。在这做一个记录\n\n##  正文开始\n###  导包\n我们使用的logback不需要特定的包，springboot已经帮我们自动依赖了\n只需要导入web包，和一个lombok包\n\n```xml\n<dependency>\n    <groupId>org.springframework.boot</groupId>\n    <artifactId>spring-boot-starter-web</artifactId>\n</dependency>\n<dependency>\n	<groupId>org.projectlombok</groupId>\n	<artifactId>lombok</artifactId>\n</dependency>\n```\n###   导入配置\n需要在我们的classpath下新建一个文件，名字：`logback-spring.xml`，或者`logback.xml`，推荐使用第一个`logback-spring.xml`，原因请看雷神视频。\n\n配置内容如下`重点`：\n\n```xml\n<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!--\nscan：当此属性设置为true时，配置文件如果发生改变，将会被重新加载，默认值为true。\nscanPeriod：设置监测配置文件是否有修改的时间间隔，如果没有给出时间单位，默认单位是毫秒当scan为true时，此属性生效。默认的时间间隔为1分钟。\ndebug：当此属性设置为true时，将打印出logback内部日志信息，实时查看logback运行状态。默认值为false。\n-->\n<configuration scan=\"false\" scanPeriod=\"60 seconds\" debug=\"false\">\n    <!-- 定义日志的根目录 -->\n    <property name=\"LOG_HOME\" value=\"./logs\" />\n    <!-- 定义日志文件名称 -->\n    <property name=\"appName\" value=\"[自己定义名字]\"></property>\n    \n    <!-- ch.qos.logback.core.ConsoleAppender 表示控制台输出 -->\n    <appender name=\"stdout\" class=\"ch.qos.logback.core.ConsoleAppender\">\n        <!--\n        日志输出格式：\n			%d表示日期时间，\n			%thread表示线程名，\n			%-5level：级别从左显示5个字符宽度\n			%logger{50} 表示logger名字最长50个字符，否则按照句点分割。 \n			%msg：日志消息，\n			%n是换行符\n        -->\n        <layout class=\"ch.qos.logback.classic.PatternLayout\">\n            <springProfile name=\"dev\">\n                <pattern>%d{yyyy-MM-dd HH:mm:ss.SSS} ----> [%thread] ---> %-5level %logger{50} - %msg%n</pattern>\n            </springProfile>\n            <springProfile name=\"!dev\">\n                <pattern>%d{yyyy-MM-dd HH:mm:ss.SSS} ==== [%thread] ==== %-5level %logger{50} - %msg%n</pattern>\n            </springProfile>\n        </layout>\n    </appender>\n\n    <!-- 滚动记录文件，先将日志记录到指定文件，当符合某个条件时，将日志记录到其他文件 -->  \n    <appender name=\"appLogAppender\" class=\"ch.qos.logback.core.rolling.RollingFileAppender\">\n        <!-- 指定日志文件的名称 -->\n        <file>${LOG_HOME}/${appName}.log</file>\n        <!--\n        当发生滚动时，决定 RollingFileAppender 的行为，涉及文件移动和重命名\n        TimeBasedRollingPolicy： 最常用的滚动策略，它根据时间来制定滚动策略，既负责滚动也负责出发滚动。\n        -->\n        <rollingPolicy class=\"ch.qos.logback.core.rolling.TimeBasedRollingPolicy\">\n            <!--\n            滚动时产生的文件的存放位置及文件名称 %d{yyyy-MM-dd}：按天进行日志滚动 \n            %i：当文件大小超过maxFileSize时，按照i进行文件滚动\n            -->\n            <fileNamePattern>${LOG_HOME}/${appName}-%d{yyyy-MM-dd}-%i.log</fileNamePattern>\n            <!-- \n            可选节点，控制保留的归档文件的最大数量，超出数量就删除旧文件。假设设置每天滚动，\n            且maxHistory是365，则只保存最近365天的文件，删除之前的旧文件。注意，删除旧文件是，\n            那些为了归档而创建的目录也会被删除。\n            -->\n            <MaxHistory>365</MaxHistory>\n            <!-- \n            当日志文件超过maxFileSize指定的大小是，根据上面提到的%i进行日志文件滚动 注意此处配置SizeBasedTriggeringPolicy是无法实现按文件大小进行滚动的，必须配置timeBasedFileNamingAndTriggeringPolicy\n            -->\n            <timeBasedFileNamingAndTriggeringPolicy class=\"ch.qos.logback.core.rolling.SizeAndTimeBasedFNATP\">\n                <maxFileSize>100MB</maxFileSize>\n            </timeBasedFileNamingAndTriggeringPolicy>\n        </rollingPolicy>\n        <!-- 日志输出格式： -->     \n        <layout class=\"ch.qos.logback.classic.PatternLayout\">\n            <pattern>%d{yyyy-MM-dd HH:mm:ss.SSS} [ %thread ] - [ %-5level ] [ %logger{50} : %line ] - %msg%n</pattern>\n        </layout>\n    </appender>\n\n    <!-- \n		logger主要用于存放日志对象，也可以定义日志类型、级别\n		name：表示匹配的logger类型前缀，也就是包的前半部分\n		level：要记录的日志级别，包括 TRACE < DEBUG < INFO < WARN < ERROR\n		additivity：作用在于children-logger是否使用 rootLogger配置的appender进行输出，\n		false：表示只用当前logger的appender-ref，true：\n		表示当前logger的appender-ref和rootLogger的appender-ref都有效\n    -->\n    <!-- hibernate logger -->\n    <logger name=\"com.fang\" level=\"warn\" />\n    <!-- Spring framework logger -->\n    <logger name=\"org.springframework\" level=\"debug\" additivity=\"false\"></logger>\n\n\n\n    <!-- \n    root与logger是父子关系，没有特别定义则默认为root，任何一个类只会和一个logger对应，\n    要么是定义的logger，要么是root，判断的关键在于找到这个logger，然后判断这个logger的appender和level。 \n    -->\n    <root level=\"info\">\n        <appender-ref ref=\"stdout\" />\n        <appender-ref ref=\"appLogAppender\" />\n    </root>\n</configuration> \n```\n里面有很多的注释，基本看了就懂\n但是有几个还是要说明一下：\n\n1、前面两个配置目录和日志名字的：目录可以指定绝对路径，也可以写相对目录，比如我上面的写法就表示在当前项目的根目录下的logs目录下，名字自己定义\n\n2、中间那个appender 名字为name=\"stdout\"的基本可以不需要动，除非你要自己过滤一下级别的信息。下面讲。\n\n3、第二个appender 名字为name=\"appLogAppender\"的是表示输出到文件的。每次滚动的时长和每个文件的大小自己定义，我上面定义了一年，也就是我的日志文件会保留过去一年以内的日志。每个日志大小`maxFileSize`我一般设置在10M，而每天的日志是会自动区分的，而且会按照日期命名保存。\n\n4、`logger`标签，用来设置某一个包或者具体的某一个类的日志打印级别，这里可以规定一些更细的记录，比如`springframework`的包打印`info`级别的日志。然后我自己写的包`fang`，只打印`WARN`级别以上的日志。\n\nname:用来指定受此loger约束的某一个包或者具体的某一个类。\nlevel:用来设置打印级别（日志级别），大小写无关：TRACE, DEBUG, INFO, WARN, ERROR, ALL 和 OFF，还有一个特俗值INHERITED或者同义词NULL，代表强制执行上级的级别。如果未设置此属性，那么当前loger将会继承上级的级别。\naddtivity:是否向上级loger传递打印信息。默认是true。\n\n5、最后的`root`标签。上面有多少个`appender`，标签中就得写多少个。root的l`level`属性，就是定义打印日志的等级。等级在注释中有。\n\n如果没有别的高级需求，以上的配置就可以直接用了\n###  使用如下：\n\n```xml\nimport lombok.extern.slf4j.Slf4j;\nimport org.springframework.web.bind.annotation.GetMapping;\nimport org.springframework.web.bind.annotation.RequestMapping;\nimport org.springframework.web.bind.annotation.RestController;\n\n/**\n * @author Bernie_xin\n * @create 2021/1/8 20:01\n **/\n@RestController\n@RequestMapping(\"/mytest\")\n@Slf4j\npublic class TestController {\n\n    @GetMapping(\"/test\")\n    public String test(){\n        log.trace(\"登录认证异常-------------->{}\", \"trace\");\n        log.debug(\"登录认证异常-------------->{}\", \"debug\");\n        log.info(\"登录认证异常-------------->{}\", \"info\");\n        log.warn(\"登录认证异常-------------->{}\", \"warn\");\n        log.error(\"登录认证异常-------------->{}\", \"error\");\n        return \"成功\";\n    }\n}\n```\n尝试看看你配置的级别还能打印吗\n\n##  在控制台输出info级别，在文件输出WARN级别\n找了这位老哥的博客 [http://www.manongjc.com/detail/6-tazecgsjdageavt.html](http://www.manongjc.com/detail/6-tazecgsjdageavt.html)\n在文件输错的标签下加入\n```xml\n<filter class=\"ch.qos.logback.classic.filter.ThresholdFilter\"><!-- 只打印INFO及其以上的日志 -->\n	<!-- 在日志配置级别的基础上过滤掉WARN级别以下的日志 -->\n	<level>WARN</level>\n</filter>\n```\n\n还有一些高级的玩法，比如级别info的输入到一个文件，级别ERROR输出到另一个文件等，等我后面学写了再写博客吧。\n\n***看完博客别忘了点个赞。***\n', '<p>学习日志管理的时候，网上查找了很多的博客，但是大多数说的都不是我想搞懂的东西，最后我找了B站尚硅谷雷神的视频看的。就比较完整且系统的了解了一下。如果需要可以自行去B站搜索springboot教程1的。</p>\n<p>看完之后，我还是去找了别的博客看了，才终于搞懂搞明白了。在这做一个记录</p>\n<h2><a id=\"_5\"></a>正文开始</h2>\n<h3><a id=\"_6\"></a>导包</h3>\n<p>我们使用的logback不需要特定的包，springboot已经帮我们自动依赖了<br />\n只需要导入web包，和一个lombok包</p>\n<pre><code class=\"lang-xml\">&lt;dependency&gt;\n    &lt;groupId&gt;org.springframework.boot&lt;/groupId&gt;\n    &lt;artifactId&gt;spring-boot-starter-web&lt;/artifactId&gt;\n&lt;/dependency&gt;\n&lt;dependency&gt;\n	&lt;groupId&gt;org.projectlombok&lt;/groupId&gt;\n	&lt;artifactId&gt;lombok&lt;/artifactId&gt;\n&lt;/dependency&gt;\n</code></pre>\n<h3><a id=\"_20\"></a>导入配置</h3>\n<p>需要在我们的classpath下新建一个文件，名字：<code>logback-spring.xml</code>，或者<code>logback.xml</code>，推荐使用第一个<code>logback-spring.xml</code>，原因请看雷神视频。</p>\n<p>配置内容如下<code>重点</code>：</p>\n<pre><code class=\"lang-xml\">&lt;?xml version=&quot;1.0&quot; encoding=&quot;UTF-8&quot;?&gt;\n&lt;!--\nscan：当此属性设置为true时，配置文件如果发生改变，将会被重新加载，默认值为true。\nscanPeriod：设置监测配置文件是否有修改的时间间隔，如果没有给出时间单位，默认单位是毫秒当scan为true时，此属性生效。默认的时间间隔为1分钟。\ndebug：当此属性设置为true时，将打印出logback内部日志信息，实时查看logback运行状态。默认值为false。\n--&gt;\n&lt;configuration scan=&quot;false&quot; scanPeriod=&quot;60 seconds&quot; debug=&quot;false&quot;&gt;\n    &lt;!-- 定义日志的根目录 --&gt;\n    &lt;property name=&quot;LOG_HOME&quot; value=&quot;./logs&quot; /&gt;\n    &lt;!-- 定义日志文件名称 --&gt;\n    &lt;property name=&quot;appName&quot; value=&quot;[自己定义名字]&quot;&gt;&lt;/property&gt;\n    \n    &lt;!-- ch.qos.logback.core.ConsoleAppender 表示控制台输出 --&gt;\n    &lt;appender name=&quot;stdout&quot; class=&quot;ch.qos.logback.core.ConsoleAppender&quot;&gt;\n        &lt;!--\n        日志输出格式：\n			%d表示日期时间，\n			%thread表示线程名，\n			%-5level：级别从左显示5个字符宽度\n			%logger{50} 表示logger名字最长50个字符，否则按照句点分割。 \n			%msg：日志消息，\n			%n是换行符\n        --&gt;\n        &lt;layout class=&quot;ch.qos.logback.classic.PatternLayout&quot;&gt;\n            &lt;springProfile name=&quot;dev&quot;&gt;\n                &lt;pattern&gt;%d{yyyy-MM-dd HH:mm:ss.SSS} ----&gt; [%thread] ---&gt; %-5level %logger{50} - %msg%n&lt;/pattern&gt;\n            &lt;/springProfile&gt;\n            &lt;springProfile name=&quot;!dev&quot;&gt;\n                &lt;pattern&gt;%d{yyyy-MM-dd HH:mm:ss.SSS} ==== [%thread] ==== %-5level %logger{50} - %msg%n&lt;/pattern&gt;\n            &lt;/springProfile&gt;\n        &lt;/layout&gt;\n    &lt;/appender&gt;\n\n    &lt;!-- 滚动记录文件，先将日志记录到指定文件，当符合某个条件时，将日志记录到其他文件 --&gt;  \n    &lt;appender name=&quot;appLogAppender&quot; class=&quot;ch.qos.logback.core.rolling.RollingFileAppender&quot;&gt;\n        &lt;!-- 指定日志文件的名称 --&gt;\n        &lt;file&gt;${LOG_HOME}/${appName}.log&lt;/file&gt;\n        &lt;!--\n        当发生滚动时，决定 RollingFileAppender 的行为，涉及文件移动和重命名\n        TimeBasedRollingPolicy： 最常用的滚动策略，它根据时间来制定滚动策略，既负责滚动也负责出发滚动。\n        --&gt;\n        &lt;rollingPolicy class=&quot;ch.qos.logback.core.rolling.TimeBasedRollingPolicy&quot;&gt;\n            &lt;!--\n            滚动时产生的文件的存放位置及文件名称 %d{yyyy-MM-dd}：按天进行日志滚动 \n            %i：当文件大小超过maxFileSize时，按照i进行文件滚动\n            --&gt;\n            &lt;fileNamePattern&gt;${LOG_HOME}/${appName}-%d{yyyy-MM-dd}-%i.log&lt;/fileNamePattern&gt;\n            &lt;!-- \n            可选节点，控制保留的归档文件的最大数量，超出数量就删除旧文件。假设设置每天滚动，\n            且maxHistory是365，则只保存最近365天的文件，删除之前的旧文件。注意，删除旧文件是，\n            那些为了归档而创建的目录也会被删除。\n            --&gt;\n            &lt;MaxHistory&gt;365&lt;/MaxHistory&gt;\n            &lt;!-- \n            当日志文件超过maxFileSize指定的大小是，根据上面提到的%i进行日志文件滚动 注意此处配置SizeBasedTriggeringPolicy是无法实现按文件大小进行滚动的，必须配置timeBasedFileNamingAndTriggeringPolicy\n            --&gt;\n            &lt;timeBasedFileNamingAndTriggeringPolicy class=&quot;ch.qos.logback.core.rolling.SizeAndTimeBasedFNATP&quot;&gt;\n                &lt;maxFileSize&gt;100MB&lt;/maxFileSize&gt;\n            &lt;/timeBasedFileNamingAndTriggeringPolicy&gt;\n        &lt;/rollingPolicy&gt;\n        &lt;!-- 日志输出格式： --&gt;     \n        &lt;layout class=&quot;ch.qos.logback.classic.PatternLayout&quot;&gt;\n            &lt;pattern&gt;%d{yyyy-MM-dd HH:mm:ss.SSS} [ %thread ] - [ %-5level ] [ %logger{50} : %line ] - %msg%n&lt;/pattern&gt;\n        &lt;/layout&gt;\n    &lt;/appender&gt;\n\n    &lt;!-- \n		logger主要用于存放日志对象，也可以定义日志类型、级别\n		name：表示匹配的logger类型前缀，也就是包的前半部分\n		level：要记录的日志级别，包括 TRACE &lt; DEBUG &lt; INFO &lt; WARN &lt; ERROR\n		additivity：作用在于children-logger是否使用 rootLogger配置的appender进行输出，\n		false：表示只用当前logger的appender-ref，true：\n		表示当前logger的appender-ref和rootLogger的appender-ref都有效\n    --&gt;\n    &lt;!-- hibernate logger --&gt;\n    &lt;logger name=&quot;com.fang&quot; level=&quot;warn&quot; /&gt;\n    &lt;!-- Spring framework logger --&gt;\n    &lt;logger name=&quot;org.springframework&quot; level=&quot;debug&quot; additivity=&quot;false&quot;&gt;&lt;/logger&gt;\n\n\n\n    &lt;!-- \n    root与logger是父子关系，没有特别定义则默认为root，任何一个类只会和一个logger对应，\n    要么是定义的logger，要么是root，判断的关键在于找到这个logger，然后判断这个logger的appender和level。 \n    --&gt;\n    &lt;root level=&quot;info&quot;&gt;\n        &lt;appender-ref ref=&quot;stdout&quot; /&gt;\n        &lt;appender-ref ref=&quot;appLogAppender&quot; /&gt;\n    &lt;/root&gt;\n&lt;/configuration&gt; \n</code></pre>\n<p>里面有很多的注释，基本看了就懂<br />\n但是有几个还是要说明一下：</p>\n<p>1、前面两个配置目录和日志名字的：目录可以指定绝对路径，也可以写相对目录，比如我上面的写法就表示在当前项目的根目录下的logs目录下，名字自己定义</p>\n<p>2、中间那个appender 名字为name=&quot;stdout&quot;的基本可以不需要动，除非你要自己过滤一下级别的信息。下面讲。</p>\n<p>3、第二个appender 名字为name=&quot;appLogAppender&quot;的是表示输出到文件的。每次滚动的时长和每个文件的大小自己定义，我上面定义了一年，也就是我的日志文件会保留过去一年以内的日志。每个日志大小<code>maxFileSize</code>我一般设置在10M，而每天的日志是会自动区分的，而且会按照日期命名保存。</p>\n<p>4、<code>logger</code>标签，用来设置某一个包或者具体的某一个类的日志打印级别，这里可以规定一些更细的记录，比如<code>springframework</code>的包打印<code>info</code>级别的日志。然后我自己写的包<code>fang</code>，只打印<code>WARN</code>级别以上的日志。</p>\n<p>name:用来指定受此loger约束的某一个包或者具体的某一个类。<br />\nlevel:用来设置打印级别（日志级别），大小写无关：TRACE, DEBUG, INFO, WARN, ERROR, ALL 和 OFF，还有一个特俗值INHERITED或者同义词NULL，代表强制执行上级的级别。如果未设置此属性，那么当前loger将会继承上级的级别。<br />\naddtivity:是否向上级loger传递打印信息。默认是true。</p>\n<p>5、最后的<code>root</code>标签。上面有多少个<code>appender</code>，标签中就得写多少个。root的l<code>level</code>属性，就是定义打印日志的等级。等级在注释中有。</p>\n<p>如果没有别的高级需求，以上的配置就可以直接用了</p>\n<h3><a id=\"_135\"></a>使用如下：</h3>\n<pre><code class=\"lang-xml\">import lombok.extern.slf4j.Slf4j;\nimport org.springframework.web.bind.annotation.GetMapping;\nimport org.springframework.web.bind.annotation.RequestMapping;\nimport org.springframework.web.bind.annotation.RestController;\n\n/**\n * @author Bernie_xin\n * @create 2021/1/8 20:01\n **/\n@RestController\n@RequestMapping(&quot;/mytest&quot;)\n@Slf4j\npublic class TestController {\n\n    @GetMapping(&quot;/test&quot;)\n    public String test(){\n        log.trace(&quot;登录认证异常--------------&gt;{}&quot;, &quot;trace&quot;);\n        log.debug(&quot;登录认证异常--------------&gt;{}&quot;, &quot;debug&quot;);\n        log.info(&quot;登录认证异常--------------&gt;{}&quot;, &quot;info&quot;);\n        log.warn(&quot;登录认证异常--------------&gt;{}&quot;, &quot;warn&quot;);\n        log.error(&quot;登录认证异常--------------&gt;{}&quot;, &quot;error&quot;);\n        return &quot;成功&quot;;\n    }\n}\n</code></pre>\n<p>尝试看看你配置的级别还能打印吗</p>\n<h2><a id=\"infoWARN_165\"></a>在控制台输出info级别，在文件输出WARN级别</h2>\n<p>找了这位老哥的博客 <a href=\"http://www.manongjc.com/detail/6-tazecgsjdageavt.html\" target=\"_blank\">http://www.manongjc.com/detail/6-tazecgsjdageavt.html</a><br />\n在文件输错的标签下加入</p>\n<pre><code class=\"lang-xml\">&lt;filter class=&quot;ch.qos.logback.classic.filter.ThresholdFilter&quot;&gt;&lt;!-- 只打印INFO及其以上的日志 --&gt;\n	&lt;!-- 在日志配置级别的基础上过滤掉WARN级别以下的日志 --&gt;\n	&lt;level&gt;WARN&lt;/level&gt;\n&lt;/filter&gt;\n</code></pre>\n<p>还有一些高级的玩法，比如级别info的输入到一个文件，级别ERROR输出到另一个文件等，等我后面学写了再写博客吧。</p>\n<p><em><strong>看完博客别忘了点个赞。</strong></em></p>\n', 'java,Spring Boot,后端,logback', 0, NULL, 1, '2021-09-13 11:30:28', '2022-03-12 15:44:49', 0);
INSERT INTO `article` VALUES ('42256fe71711d2aeb84b18bf4e00f4fb', '598108905656729600', 'springboot之shiro(入门)', 'springboot之shiro', '\n@[TOC](使用shiro搭建一个简单的系统)\n# 搭建一个简单的系统框架\n# shiro环境搭建\n## 导包\n注意是整合soringboot的包\n\n```java\n<!-- https://mvnrepository.com/artifact/org.apache.shiro/shiro-spring -->\n<dependency>\n	<groupId>org.apache.shiro</groupId>\n	<artifactId>shiro-spring</artifactId>\n	<version>1.5.3</version>\n</dependency>\n```\n## 三个 Bean\n\n```java\n@Configuration\npublic class ShiroConfig {\n\n    @Bean\n    public ShiroFilterFactoryBean getShiroFilterFactoryBean(@Qualifier(\"securityManager\")DefaultWebSecurityManager securityManager){\n        ShiroFilterFactoryBean bean = new ShiroFilterFactoryBean();\n        bean.setSecurityManager(securityManager);\n        return bean;\n    }\n\n    @Bean(name = \"securityManager\")\n    public DefaultWebSecurityManager getDefaultWebSecurityManager(@Qualifier(\"userRealm\") UserRealm userRealm){\n        DefaultWebSecurityManager securityManager = new DefaultWebSecurityManager();\n        securityManager.setRealm(userRealm);\n        return securityManager;\n    }\n\n    @Bean\n    public UserRealm userRealm(){\n        return new UserRealm();\n    }\n    \n}\n```\n## 和一个自定义的Realm\n\n```java\npublic class UserRealm extends AuthorizingRealm {\n\n    @Override\n    protected AuthorizationInfo doGetAuthorizationInfo(PrincipalCollection principalCollection) {\n        return null;\n    }\n\n    @Override\n    protected AuthenticationInfo doGetAuthenticationInfo(AuthenticationToken token) throws AuthenticationException {\n        return null;\n    }\n}\n```\n\n# 拦截，认证和授权\n## 拦截\n在刚刚搭建起来的环境中定制。\n有一些还用不到的代码，先贴上\n```java\n@Bean\n    public ShiroFilterFactoryBean getShiroFilterFactoryBean(@Qualifier(\"securityManager\")DefaultWebSecurityManager securityManager){\n        ShiroFilterFactoryBean bean = new ShiroFilterFactoryBean();\n        bean.setSecurityManager(securityManager);\n\n        Map<String, String> filter = new LinkedHashMap<>();//拦截器\n        filter.put(\"/user/add\", \"perms[user:add]\");//拦截\"/user/add\"请求，需要有[user:add]权限才可以进入\n        filter.put(\"/user/update\", \"perms[user:update]\");\n\n        bean.setFilterChainDefinitionMap(filter);//设置烂机器\n        bean.setLoginUrl(\"/toLogin\");//设置登录请求\n        //shiro没有像security的自带登录页面\n        bean.setUnauthorizedUrl(\"/noAuth\");//设置没有权限显示的页面\n        return bean;\n    }\n```\n在`filter`那里设置了拦截，然后运行测试是否拦截成功。如果没有设置登录请求会报404错误\n## 认证\n认证是写在刚刚自定义的`Realm`里面。点击登录的时候，会走这个方法。\n当然我们还需要一个处理登录的请求。\n\n这是控制层的方法。正常流程应该是控制层调用服务层去执行操作\n这些基本上都是死代码，固定的\n```java\n @RequestMapping(\"/login\")\n    public String login(String username,String password,Model model){\n        Subject subject = SecurityUtils.getSubject();\n        UsernamePasswordToken token = new UsernamePasswordToken(username, password);\n        try {\n            subject.login(token);\n            return \"index\";\n        }catch (UnknownAccountException e) {\n            model.addAttribute(\"msg\", \"用户名错误！\");\n            return \"login\";\n        }catch (IncorrectCredentialsException e) {\n            model.addAttribute(\"msg\", \"密码错误！\");\n            return \"login\";\n        }\n\n    }\n```\n然后\n\n```java\n@Override\n    protected AuthenticationInfo doGetAuthenticationInfo(AuthenticationToken token) throws AuthenticationException {\n        UsernamePasswordToken userToken = (UsernamePasswordToken) token;\n        //这里是链接数据库了，用的是mybatis链接\n        User user = userMapper.queryUserByName(userToken.getUsername());\n        \n        if (user== null){\n            return null;//报错 UnknownAccountException：用户名不存在\n        }\n\n        Subject subject = SecurityUtils.getSubject();\n        subject.getSession().setAttribute(\"loginUser\", user);//往session注入一个user\n\n        return new SimpleAuthenticationInfo(user, user.getPassword(), \"\");//返回一个简单认证\n    }\n```\n测试是否可以连接数据库进行认证\n## 授权\n\n```java\n @Override\n    protected AuthorizationInfo doGetAuthorizationInfo(PrincipalCollection principalCollection) {\n        SimpleAuthorizationInfo info = new SimpleAuthorizationInfo();\n\n        Subject subject = SecurityUtils.getSubject();\n        User currentUser = (User) subject.getPrincipal();//拿到当前登录用户\n\n        info.addStringPermission(currentUser.getPerms());//从数据库获取权限并授权\n        return info;\n    }\n```\n# 整合thyemleaf\n导入整合包\n```java\n<dependency>\n	<groupId>com.github.theborakompanioni</groupId>\n	<artifactId>thymeleaf-extras-shiro</artifactId>\n	<version>2.0.0</version>\n</dependency>\n```\n需要配置，一同写在`ShiroConfig` 类里面\n\n```java\n@Bean\npublic ShiroDialect getShiroDialect(){\n	return new ShiroDialect();\n}\n```\n然后就是把一些用户没有权限的版块隐藏\n\n```java\n<div shiro:haspermission=\"这里写权限，比如: user:add\">\n	······\n</div>\n```\n\n\nshiro学习简单记录到这里结束。', '<p><h3>使用shiro搭建一个简单的系统</h3><ul><li><a href=\"#_2\">搭建一个简单的系统框架</a></li><li><a href=\"#shiro_3\">shiro环境搭建</a></li><ul><li><a href=\"#_4\">导包</a></li><li><a href=\"#_Bean_15\">三个 Bean</a></li><li><a href=\"#Realm_42\">和一个自定义的Realm</a></li></ul><li><a href=\"#_59\">拦截，认证和授权</a></li><ul><li><a href=\"#_60\">拦截</a></li><li><a href=\"#_81\">认证</a></li><li><a href=\"#_125\">授权</a></li></ul><li><a href=\"#thyemleaf_139\">整合thyemleaf</a></li></ul></p>\n<h1><a id=\"_2\"></a>搭建一个简单的系统框架</h1>\n<h1><a id=\"shiro_3\"></a>shiro环境搭建</h1>\n<h2><a id=\"_4\"></a>导包</h2>\n<p>注意是整合soringboot的包</p>\n<pre><code class=\"lang-java\">&lt;!-- https://mvnrepository.com/artifact/org.apache.shiro/shiro-spring --&gt;\n&lt;dependency&gt;\n	&lt;groupId&gt;org.apache.shiro&lt;/groupId&gt;\n	&lt;artifactId&gt;shiro-spring&lt;/artifactId&gt;\n	&lt;version&gt;1.5.3&lt;/version&gt;\n&lt;/dependency&gt;\n</code></pre>\n<h2><a id=\"_Bean_15\"></a>三个 Bean</h2>\n<pre><code class=\"lang-java\">@Configuration\npublic class ShiroConfig {\n\n    @Bean\n    public ShiroFilterFactoryBean getShiroFilterFactoryBean(@Qualifier(&quot;securityManager&quot;)DefaultWebSecurityManager securityManager){\n        ShiroFilterFactoryBean bean = new ShiroFilterFactoryBean();\n        bean.setSecurityManager(securityManager);\n        return bean;\n    }\n\n    @Bean(name = &quot;securityManager&quot;)\n    public DefaultWebSecurityManager getDefaultWebSecurityManager(@Qualifier(&quot;userRealm&quot;) UserRealm userRealm){\n        DefaultWebSecurityManager securityManager = new DefaultWebSecurityManager();\n        securityManager.setRealm(userRealm);\n        return securityManager;\n    }\n\n    @Bean\n    public UserRealm userRealm(){\n        return new UserRealm();\n    }\n    \n}\n</code></pre>\n<h2><a id=\"Realm_42\"></a>和一个自定义的Realm</h2>\n<pre><code class=\"lang-java\">public class UserRealm extends AuthorizingRealm {\n\n    @Override\n    protected AuthorizationInfo doGetAuthorizationInfo(PrincipalCollection principalCollection) {\n        return null;\n    }\n\n    @Override\n    protected AuthenticationInfo doGetAuthenticationInfo(AuthenticationToken token) throws AuthenticationException {\n        return null;\n    }\n}\n</code></pre>\n<h1><a id=\"_59\"></a>拦截，认证和授权</h1>\n<h2><a id=\"_60\"></a>拦截</h2>\n<p>在刚刚搭建起来的环境中定制。<br />\n有一些还用不到的代码，先贴上</p>\n<pre><code class=\"lang-java\">@Bean\n    public ShiroFilterFactoryBean getShiroFilterFactoryBean(@Qualifier(&quot;securityManager&quot;)DefaultWebSecurityManager securityManager){\n        ShiroFilterFactoryBean bean = new ShiroFilterFactoryBean();\n        bean.setSecurityManager(securityManager);\n\n        Map&lt;String, String&gt; filter = new LinkedHashMap&lt;&gt;();//拦截器\n        filter.put(&quot;/user/add&quot;, &quot;perms[user:add]&quot;);//拦截&quot;/user/add&quot;请求，需要有[user:add]权限才可以进入\n        filter.put(&quot;/user/update&quot;, &quot;perms[user:update]&quot;);\n\n        bean.setFilterChainDefinitionMap(filter);//设置烂机器\n        bean.setLoginUrl(&quot;/toLogin&quot;);//设置登录请求\n        //shiro没有像security的自带登录页面\n        bean.setUnauthorizedUrl(&quot;/noAuth&quot;);//设置没有权限显示的页面\n        return bean;\n    }\n</code></pre>\n<p>在<code>filter</code>那里设置了拦截，然后运行测试是否拦截成功。如果没有设置登录请求会报404错误</p>\n<h2><a id=\"_81\"></a>认证</h2>\n<p>认证是写在刚刚自定义的<code>Realm</code>里面。点击登录的时候，会走这个方法。<br />\n当然我们还需要一个处理登录的请求。</p>\n<p>这是控制层的方法。正常流程应该是控制层调用服务层去执行操作<br />\n这些基本上都是死代码，固定的</p>\n<pre><code class=\"lang-java\"> @RequestMapping(&quot;/login&quot;)\n    public String login(String username,String password,Model model){\n        Subject subject = SecurityUtils.getSubject();\n        UsernamePasswordToken token = new UsernamePasswordToken(username, password);\n        try {\n            subject.login(token);\n            return &quot;index&quot;;\n        }catch (UnknownAccountException e) {\n            model.addAttribute(&quot;msg&quot;, &quot;用户名错误！&quot;);\n            return &quot;login&quot;;\n        }catch (IncorrectCredentialsException e) {\n            model.addAttribute(&quot;msg&quot;, &quot;密码错误！&quot;);\n            return &quot;login&quot;;\n        }\n\n    }\n</code></pre>\n<p>然后</p>\n<pre><code class=\"lang-java\">@Override\n    protected AuthenticationInfo doGetAuthenticationInfo(AuthenticationToken token) throws AuthenticationException {\n        UsernamePasswordToken userToken = (UsernamePasswordToken) token;\n        //这里是链接数据库了，用的是mybatis链接\n        User user = userMapper.queryUserByName(userToken.getUsername());\n        \n        if (user== null){\n            return null;//报错 UnknownAccountException：用户名不存在\n        }\n\n        Subject subject = SecurityUtils.getSubject();\n        subject.getSession().setAttribute(&quot;loginUser&quot;, user);//往session注入一个user\n\n        return new SimpleAuthenticationInfo(user, user.getPassword(), &quot;&quot;);//返回一个简单认证\n    }\n</code></pre>\n<p>测试是否可以连接数据库进行认证</p>\n<h2><a id=\"_125\"></a>授权</h2>\n<pre><code class=\"lang-java\"> @Override\n    protected AuthorizationInfo doGetAuthorizationInfo(PrincipalCollection principalCollection) {\n        SimpleAuthorizationInfo info = new SimpleAuthorizationInfo();\n\n        Subject subject = SecurityUtils.getSubject();\n        User currentUser = (User) subject.getPrincipal();//拿到当前登录用户\n\n        info.addStringPermission(currentUser.getPerms());//从数据库获取权限并授权\n        return info;\n    }\n</code></pre>\n<h1><a id=\"thyemleaf_139\"></a>整合thyemleaf</h1>\n<p>导入整合包</p>\n<pre><code class=\"lang-java\">&lt;dependency&gt;\n	&lt;groupId&gt;com.github.theborakompanioni&lt;/groupId&gt;\n	&lt;artifactId&gt;thymeleaf-extras-shiro&lt;/artifactId&gt;\n	&lt;version&gt;2.0.0&lt;/version&gt;\n&lt;/dependency&gt;\n</code></pre>\n<p>需要配置，一同写在<code>ShiroConfig</code> 类里面</p>\n<pre><code class=\"lang-java\">@Bean\npublic ShiroDialect getShiroDialect(){\n	return new ShiroDialect();\n}\n</code></pre>\n<p>然后就是把一些用户没有权限的版块隐藏</p>\n<pre><code class=\"lang-java\">&lt;div shiro:haspermission=&quot;这里写权限，比如: user:add&quot;&gt;\n	······\n&lt;/div&gt;\n</code></pre>\n<p>shiro学习简单记录到这里结束。</p>\n', 'shiro,java,Spring Boot', 0, '\r\nhttp://image.fangweb.top/featured-lg.jpg', 1, '2021-09-13 11:32:59', '2022-03-12 15:44:50', 0);
INSERT INTO `article` VALUES ('7ca40daada9c2cdd81e17e51947d13d9', '598108905656729600', 'org.apache.shiro.authc.UnknownAccountException错误，亲测可用', '排坑UnknownAccountException，亲测可用', '# 踩坑记录\n\nspringboot整合shiro之后，测试登录报错【org.apache.shiro.authc.UnknownAccountException】\n\n登录成功与否都报错。\n\n\n# 错误原因\n找了别人的博客都不行，自己debug走排坑。发现登录的时候`Realm`的认证方法走了两次。\n\n**等于说登录方法被拦截了，登陆之前走了一次，登录的时候又走了一次**\n登录之前走的Realm认证方法，里面token啥都没有或者已经过期了，所有拿不到东西，拿不到东西数据库就查不到数据，那你的user类就是null，就会报这个错\n\n\n# 解决方法\nshiro配置的时候，排出你的登录接口，如下。\n\n在你配置的地方，添加`filterRuleMap.put(\"/common/login\", \"anon\");`\n`/common/login`是你的登录接口\n```java\n//配置拦截器\n  @Bean\n  public ShiroFilterFactoryBean shiroFilterFactoryBean(@Qualifier(\"securityManager\") DefaultWebSecurityManager defaultWebSecurityManager) {\n      ShiroFilterFactoryBean shiroFilterFactoryBean = new ShiroFilterFactoryBean();\n      shiroFilterFactoryBean.setSecurityManager(defaultWebSecurityManager);\n      /**\n       *添加Shiro内置过滤器\n       * 常用的过滤器：\n       *    anon:无需认证（登录）可以访问\n       *    authc:必须认证才可以访问\n       *    user:如果使用rememberMe的功能可以直接访问\n       *    perms:该资源必须得到资源权限才可以访问\n       *    role:该资源必须得到角色权限才可以访问\n       */\n      Map<String, Filter> filterMap = new HashMap<>();\n      filterMap.put(\"jwt\", new JWTFilter());\n      filterMap.put(\"corsAuthenticationFilter\", corsAuthenticationFilter());\n      shiroFilterFactoryBean.setFilters(filterMap);\n      Map<String, String> filterRuleMap = new HashMap<>();\n      filterRuleMap.put(\"/**\", \"jwt\");\n      filterRuleMap.put(\"/common/login\", \"anon\"); //放行登录接口\n      shiroFilterFactoryBean.setFilterChainDefinitionMap(filterRuleMap);\n      return shiroFilterFactoryBean;\n  }\n```\n\n另外：如果需要spring boot 整合shiro的配置，可以参考我的仓库：[springboot 整合shiro配置仓库](https://gitee.com/bernie__gitee/springboot-shiro)\n里面的**登录接口**和**认证** **授权方法**需要自己修改\n\n', '<h1><a id=\"_0\"></a>踩坑记录</h1>\n<p>springboot整合shiro之后，测试登录报错【org.apache.shiro.authc.UnknownAccountException】</p>\n<p>登录成功与否都报错。</p>\n<h1><a id=\"_7\"></a>错误原因</h1>\n<p>找了别人的博客都不行，自己debug走排坑。发现登录的时候<code>Realm</code>的认证方法走了两次。</p>\n<p><strong>等于说登录方法被拦截了，登陆之前走了一次，登录的时候又走了一次</strong><br />\n登录之前走的Realm认证方法，里面token啥都没有或者已经过期了，所有拿不到东西，拿不到东西数据库就查不到数据，那你的user类就是null，就会报这个错</p>\n<h1><a id=\"_14\"></a>解决方法</h1>\n<p>shiro配置的时候，排出你的登录接口，如下。</p>\n<p>在你配置的地方，添加<code>filterRuleMap.put(&quot;/common/login&quot;, &quot;anon&quot;);</code><br />\n<code>/common/login</code>是你的登录接口</p>\n<pre><code class=\"lang-java\">//配置拦截器\n  @Bean\n  public ShiroFilterFactoryBean shiroFilterFactoryBean(@Qualifier(&quot;securityManager&quot;) DefaultWebSecurityManager defaultWebSecurityManager) {\n      ShiroFilterFactoryBean shiroFilterFactoryBean = new ShiroFilterFactoryBean();\n      shiroFilterFactoryBean.setSecurityManager(defaultWebSecurityManager);\n      /**\n       *添加Shiro内置过滤器\n       * 常用的过滤器：\n       *    anon:无需认证（登录）可以访问\n       *    authc:必须认证才可以访问\n       *    user:如果使用rememberMe的功能可以直接访问\n       *    perms:该资源必须得到资源权限才可以访问\n       *    role:该资源必须得到角色权限才可以访问\n       */\n      Map&lt;String, Filter&gt; filterMap = new HashMap&lt;&gt;();\n      filterMap.put(&quot;jwt&quot;, new JWTFilter());\n      filterMap.put(&quot;corsAuthenticationFilter&quot;, corsAuthenticationFilter());\n      shiroFilterFactoryBean.setFilters(filterMap);\n      Map&lt;String, String&gt; filterRuleMap = new HashMap&lt;&gt;();\n      filterRuleMap.put(&quot;/**&quot;, &quot;jwt&quot;);\n      filterRuleMap.put(&quot;/common/login&quot;, &quot;anon&quot;); //放行登录接口\n      shiroFilterFactoryBean.setFilterChainDefinitionMap(filterRuleMap);\n      return shiroFilterFactoryBean;\n  }\n</code></pre>\n<p>另外：如果需要spring boot 整合shiro的配置，可以参考我的仓库：<a href=\"https://gitee.com/bernie__gitee/springboot-shiro\" target=\"_blank\">springboot 整合shiro配置仓库</a><br />\n里面的<strong>登录接口</strong>和<strong>认证</strong> <strong>授权方法</strong>需要自己修改</p>\n', 'shiro,Spring Boot,java', 0, 'http://image.fangweb.top/FkKhBIn-nhjLS1khtau6jssWDSj3', 1, '2021-09-13 11:26:33', '2022-03-12 15:44:50', 0);
INSERT INTO `article` VALUES ('8e54e4d765e2b20b4b2761ca48807bf4', '598108905656729600', 'springboot之网站超级简单拦截器', 'springboot之网站超级简单拦截器', '## 简单拦截器的实现\n\n - 	需要有一个继承`HandlerInterceptor`的类\n \n	\n	这个类中只需要重写`preHandle()`方法即可。\n		***Talking is cheap~~*** ，先上代码，后面解释。\n	\n\n```java\npublic class LoginHandlerInterceptor implements HandlerInterceptor {\n    @Override\n    public boolean preHandle(HttpServletRequest request, HttpServletResponse response, Object handler) throws Exception {\n        Object loginUser = request.getSession().getAttribute(\"loginUser\");\n        if (loginUser == null){\n            request.setAttribute(\"msg\", \"没有权限，请先登录!\");\n            request.getRequestDispatcher(\"/index.html\").forward(request, response);\n            return false;\n        }else {\n            return true;\n        }\n    }\n}\n```\n\n第一行是查看我在登陆成功的时候放入的`session`，如果有就放行，返回true。没有则提示：没有权限，请先登录。然后跳转到首页登陆。\n	\n\n```java\n @RequestMapping(\"/user/login\")\n    public String login(@RequestParam(\"username\")String username,\n                        @RequestParam(\"password\")String password,\n                        Model model, HttpSession session){\n        if (!StringUtils.isEmpty(username) && \"123\".equals(password)){\n            session.setAttribute(\"loginUser\", username);\n            return  \"redirect:/main.html\";\n        }else {\n            model.addAttribute(\"msg\", \"用户名或密码错误\");\n            return \"index\";\n        }\n    }\n```\n这里正常是需要去数据库查询账号密码判断是否正确的。\n*但是我就是不，就是偷懒，你咬我啊*~ 略略略*\n一切从简。用户名不为空，密码是123就可以了。好了就看下一步\n\n\n - 将类托管给spring\n\n```java\n @Override\n    public void addInterceptors(InterceptorRegistry registry) {\n        registry.addInterceptor(new LoginHandlerInterceptor())\n                .addPathPatterns(\"/**\")\n                .excludePathPatterns(\"/index.html\",\"/\",\"/user/login\",\"/asserts/**\");\n    }\n```\n一样在实现`WebMvcConfigurer`接口的类中重写`addInterceptors()`即可。格式如上，`addPathPatterns`拦截所有页面，`excludePathPatterns`排除不拦截的页面。\n\n\n测试一下。成功！搞定收工。\n如果你都觉得这个文章帮助到你了，请点个赞，谢谢！', '<h2><a id=\"_0\"></a>简单拦截器的实现</h2>\n<ul>\n<li>\n<p>需要有一个继承<code>HandlerInterceptor</code>的类</p>\n<p>这个类中只需要重写<code>preHandle()</code>方法即可。<br />\n<em><strong>Talking is cheap~~</strong></em> ，先上代码，后面解释。</p>\n</li>\n</ul>\n<pre><code class=\"lang-java\">public class LoginHandlerInterceptor implements HandlerInterceptor {\n    @Override\n    public boolean preHandle(HttpServletRequest request, HttpServletResponse response, Object handler) throws Exception {\n        Object loginUser = request.getSession().getAttribute(&quot;loginUser&quot;);\n        if (loginUser == null){\n            request.setAttribute(&quot;msg&quot;, &quot;没有权限，请先登录!&quot;);\n            request.getRequestDispatcher(&quot;/index.html&quot;).forward(request, response);\n            return false;\n        }else {\n            return true;\n        }\n    }\n}\n</code></pre>\n<p>第一行是查看我在登陆成功的时候放入的<code>session</code>，如果有就放行，返回true。没有则提示：没有权限，请先登录。然后跳转到首页登陆。</p>\n<pre><code class=\"lang-java\"> @RequestMapping(&quot;/user/login&quot;)\n    public String login(@RequestParam(&quot;username&quot;)String username,\n                        @RequestParam(&quot;password&quot;)String password,\n                        Model model, HttpSession session){\n        if (!StringUtils.isEmpty(username) &amp;&amp; &quot;123&quot;.equals(password)){\n            session.setAttribute(&quot;loginUser&quot;, username);\n            return  &quot;redirect:/main.html&quot;;\n        }else {\n            model.addAttribute(&quot;msg&quot;, &quot;用户名或密码错误&quot;);\n            return &quot;index&quot;;\n        }\n    }\n</code></pre>\n<p>这里正常是需要去数据库查询账号密码判断是否正确的。<br />\n<em>但是我就是不，就是偷懒，你咬我啊</em>~ 略略略*<br />\n一切从简。用户名不为空，密码是123就可以了。好了就看下一步</p>\n<ul>\n<li>将类托管给spring</li>\n</ul>\n<pre><code class=\"lang-java\"> @Override\n    public void addInterceptors(InterceptorRegistry registry) {\n        registry.addInterceptor(new LoginHandlerInterceptor())\n                .addPathPatterns(&quot;/**&quot;)\n                .excludePathPatterns(&quot;/index.html&quot;,&quot;/&quot;,&quot;/user/login&quot;,&quot;/asserts/**&quot;);\n    }\n</code></pre>\n<p>一样在实现<code>WebMvcConfigurer</code>接口的类中重写<code>addInterceptors()</code>即可。格式如上，<code>addPathPatterns</code>拦截所有页面，<code>excludePathPatterns</code>排除不拦截的页面。</p>\n<p>测试一下。成功！搞定收工。<br />\n如果你都觉得这个文章帮助到你了，请点个赞，谢谢！</p>\n', 'java,Spring,后端,拦截器', 0, NULL, 1, '2021-09-13 11:36:34', '2022-03-12 15:44:51', 0);
INSERT INTO `article` VALUES ('c78ec1e84c94e5f90ef186ee97f627db', '598108905656729600', 'springboot之原生代码链接数据库实现增删查改(超级简单，一看便懂)', 'springboot之原生代码链接数据库实现增删查改', '## 连接mysql操作数据库\nspringboot帮我们简化了很多东西。链接数据库变得超级容易。\n\n - **首先，导包**\n\n```java\n<dependency>\n   <groupId>org.springframework.boot</groupId>\n   <artifactId>spring-boot-starter-jdbc</artifactId>\n</dependency>\n<!--mqsql驱动包-->\n<dependency>\n   <groupId>mysql</groupId>\n   <artifactId>mysql-connector-java</artifactId>\n   <scope>runtime</scope>\n</dependency>\n```\n\n\n - 然后老规矩，***Talking is cheap~*** 上代码。\n\n```java\nspring:\n  datasource:\n    username: root\n    password: 123456 //这里写你自己的数据库密码\n    url: jdbc:mysql://localhost:3306/springboot?useUnicode=true&characterEncoding=utf-8&useSSL=false\n```\n在你的application.properties或者application.yml文件里面加入链接数据库的配置。\n\n如果你看不懂，回去把JDBC再学一遍。\n\n- 这样就可以链接到数据库啦。我们来写个测试。\n\n```java\n@RestController\npublic class JDBCController {\n\n    @Autowired\n    JdbcTemplate jdbcTemplate;\n\n    @GetMapping(\"/jdbcTest\")\n    public List<Map<String, Object>> userList(){\n        String sql = \"select * from users\";\n        List<Map<String, Object>> maps = jdbcTemplate.queryForList(sql);\n        return maps;\n    }\n    \n}\n```\n新建一个Controller类，自动注入`JdbcTemplate` ，JdbcTemplate是springboot已经封装好的类，直接用就好了。特别方便，里面很多重载方法。sql语句自己写，跟原生JDBC一样的操作。\n\n**你是不是好奇我为什么用 `List<Map<String, Object>>`？** \n嘿嘿，我又偷懒了。没写实体类。你咬我啊，略略略···\n\n- 运行测试。跑起来！\n![在这里插入图片描述](https://img-blog.csdnimg.cn/20200722012220117.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L0Jlcm5pZV83,size_16,color_FFFFFF,t_70)\n成功！\n\n是不是很简单？？？？？\n\n如果帮助到你了，请给个赞吧！', '<h2><a id=\"mysql_0\"></a>连接mysql操作数据库</h2>\n<p>springboot帮我们简化了很多东西。链接数据库变得超级容易。</p>\n<ul>\n<li><strong>首先，导包</strong></li>\n</ul>\n<pre><code class=\"lang-java\">&lt;dependency&gt;\n   &lt;groupId&gt;org.springframework.boot&lt;/groupId&gt;\n   &lt;artifactId&gt;spring-boot-starter-jdbc&lt;/artifactId&gt;\n&lt;/dependency&gt;\n&lt;!--mqsql驱动包--&gt;\n&lt;dependency&gt;\n   &lt;groupId&gt;mysql&lt;/groupId&gt;\n   &lt;artifactId&gt;mysql-connector-java&lt;/artifactId&gt;\n   &lt;scope&gt;runtime&lt;/scope&gt;\n&lt;/dependency&gt;\n</code></pre>\n<ul>\n<li>然后老规矩，<em><strong>Talking is cheap~</strong></em> 上代码。</li>\n</ul>\n<pre><code class=\"lang-java\">spring:\n  datasource:\n    username: root\n    password: 123456 //这里写你自己的数据库密码\n    url: jdbc:mysql://localhost:3306/springboot?useUnicode=true&amp;characterEncoding=utf-8&amp;useSSL=false\n</code></pre>\n<p>在你的application.properties或者application.yml文件里面加入链接数据库的配置。</p>\n<p>如果你看不懂，回去把JDBC再学一遍。</p>\n<ul>\n<li>这样就可以链接到数据库啦。我们来写个测试。</li>\n</ul>\n<pre><code class=\"lang-java\">@RestController\npublic class JDBCController {\n\n    @Autowired\n    JdbcTemplate jdbcTemplate;\n\n    @GetMapping(&quot;/jdbcTest&quot;)\n    public List&lt;Map&lt;String, Object&gt;&gt; userList(){\n        String sql = &quot;select * from users&quot;;\n        List&lt;Map&lt;String, Object&gt;&gt; maps = jdbcTemplate.queryForList(sql);\n        return maps;\n    }\n    \n}\n</code></pre>\n<p>新建一个Controller类，自动注入<code>JdbcTemplate</code> ，JdbcTemplate是springboot已经封装好的类，直接用就好了。特别方便，里面很多重载方法。sql语句自己写，跟原生JDBC一样的操作。</p>\n<p><strong>你是不是好奇我为什么用 <code>List&lt;Map&lt;String, Object&gt;&gt;</code>？</strong><br />\n嘿嘿，我又偷懒了。没写实体类。你咬我啊，略略略···</p>\n<ul>\n<li>运行测试。跑起来！<br />\n<img src=\"https://img-blog.csdnimg.cn/20200722012220117.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L0Jlcm5pZV83,size_16,color_FFFFFF,t_70\" alt=\"在这里插入图片描述\" /><br />\n成功！</li>\n</ul>\n<p>是不是很简单？？？？？</p>\n<p>如果帮助到你了，请给个赞吧！</p>\n', 'musql,数据库,jdbc,Spring Boot,java', 0, NULL, 1, '2021-09-13 11:35:33', '2022-03-12 15:44:52', 0);
INSERT INTO `article` VALUES ('e4e82757751b1c8fb4848a677f7db45b', '598108905656729600', 'vsCode找不到文件‘firefox’。请确定文件名是否正确后再试一次', 'vsCode找不到文件‘firefox’，解决方法', '就是这个问题，困扰了我好久。百度也百度不出来，最后终于让我找到原因了。\n\nvcCode写好了html文件之后，想查看，但是无法用Firefox打开。\n![在这里插入图片描述](https://img-blog.csdnimg.cn/20200531233058642.png)\n![在这里插入图片描述](https://img-blog.csdnimg.cn/20200531233214331.png)\n我的Firefox路径是\"D:\\Program Files\\Mozilla Firefox\\firefox.exe\n我习惯把所有的东西放在C盘以外的磁盘。Firefox就是，然后导致win10设置默认应用找不到我的Firefox，VScode也是一样。\n\n****解决办法就是，把你的Firefox或者Chrome按照默认安装在C盘，一个浏览器产生的垃圾文件也不会很多。安装在C盘之后就可以设置VScode默认浏览器为Firefox或者Chrome了。如果不懂，自己百度一下怎么默认设置就好了。我不多写了。****\n', '<p>就是这个问题，困扰了我好久。百度也百度不出来，最后终于让我找到原因了。</p>\n<p>vcCode写好了html文件之后，想查看，但是无法用Firefox打开。<br />\n<img src=\"https://img-blog.csdnimg.cn/20200531233058642.png\" alt=\"在这里插入图片描述\" /><br />\n<img src=\"https://img-blog.csdnimg.cn/20200531233214331.png\" alt=\"在这里插入图片描述\" /><br />\n我的Firefox路径是&quot;D:\\Program Files\\Mozilla Firefox\\firefox.exe<br />\n我习惯把所有的东西放在C盘以外的磁盘。Firefox就是，然后导致win10设置默认应用找不到我的Firefox，VScode也是一样。</p>\n<p><strong><strong>解决办法就是，把你的Firefox或者Chrome按照默认安装在C盘，一个浏览器产生的垃圾文件也不会很多。安装在C盘之后就可以设置VScode默认浏览器为Firefox或者Chrome了。如果不懂，自己百度一下怎么默认设置就好了。我不多写了。</strong></strong></p>\n', 'firefox,html,window,html4', 0, NULL, 1, '2021-09-13 13:01:48', '2022-03-12 15:44:52', 0);
INSERT INTO `article` VALUES ('e86c2f443f04c768917ff28c07dfacee', '598108905656729600', 'vue使用Better-Scroll无法拖动', 'vue组件问题', '# vue使用Better-Scroll无法拖动\n\n学习vue的时候，写移动端的页面，使用Better-Scroll的时候因为办法引发的惨案！\n\n我使用的是2.x的版本，然而学习的时候是1.x的版本，我并不知道，写完发现无法滚动了。\n\n百度了，有人说是子组件的高度大于父组件的高度。\n于是，我查看了高度，确实如此，于是限定了高度。发现还是不行。\n\n然后继续百度。。。基本试遍了所有的方法。\n\n最后问了道友，他问我是不是2的版本，我说应该是吧，我命令行安装的，都是最新的版本。然后给我一个图，让我把这个加上。在此我就放他的图了\n![在这里插入图片描述](https://img-blog.csdnimg.cn/2021041514580433.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L0Jlcm5pZV83,size_16,color_FFFFFF,t_70)\n也就是加入这个\n```javascript\n      this.scroll = new BScroll(this.$refs.wrapper, {\n        observeDOM:true // 记住这一行\n      });\n```\n\n做一个记录，如果能帮到你，我就很满足了。', '<h1><a id=\"vueBetterScroll_0\"></a>vue使用Better-Scroll无法拖动</h1>\n<p>学习vue的时候，写移动端的页面，使用Better-Scroll的时候因为办法引发的惨案！</p>\n<p>我使用的是2.x的版本，然而学习的时候是1.x的版本，我并不知道，写完发现无法滚动了。</p>\n<p>百度了，有人说是子组件的高度大于父组件的高度。<br />\n于是，我查看了高度，确实如此，于是限定了高度。发现还是不行。</p>\n<p>然后继续百度。。。基本试遍了所有的方法。</p>\n<p>最后问了道友，他问我是不是2的版本，我说应该是吧，我命令行安装的，都是最新的版本。然后给我一个图，让我把这个加上。在此我就放他的图了<br />\n<img src=\"https://img-blog.csdnimg.cn/2021041514580433.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L0Jlcm5pZV83,size_16,color_FFFFFF,t_70\" alt=\"在这里插入图片描述\" /><br />\n也就是加入这个</p>\n<pre><code class=\"lang-javascript\">      this.scroll = new BScroll(this.$refs.wrapper, {\n        observeDOM:true // 记住这一行\n      });\n</code></pre>\n<p>做一个记录，如果能帮到你，我就很满足了。</p>\n', 'vue,js,css3', 0, NULL, 1, '2021-09-13 11:28:45', '2022-03-12 15:44:53', 0);

